  [],\n\t\"revision_timestamp\": \"2016-10-15T16:34:18.555078\",\n\t\"name\": \"rachel-carson-national-wildlife-refuge-annual-narrative-report-1992\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rachel
  Carson National Wildlife Refuge outlines Refuge accomplishments during the 1992
  calendar year. The report begins with a summary of the year's  weather conditions.
  Land acquisition is covered. The report includes a planning section which focused
  on the planning efforts for the proposed Visitor/Environmental Education Center.
  Refuge administration is outlined; information about personnel, revenue sharing,
  volunteer program, funding and safety is covered. Habitat management is also covered;
  subjects include wetlands, forests, grasslands, and fire management. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, other migratory birds,
  game mammals, and marine mammals. The public uses of the Refuge described in this
  report include interpretive programs, hunting, fishing, wildlife observation, outdoor
  recreation, and law enforcement. The equipment and facilities section of the report
  provides information about major maintenance.\",\n\t\"license_title\": \"License
